const e=JSON.parse('{"key":"v-9bc90e1e","path":"/travel/2023.8.27%20%E9%9D%92%E5%B2%9B%E6%B8%B8%E8%AE%B0.html","title":"2023.8.27 青岛游记","lang":"zh-CN","frontmatter":{"title":"2023.8.27 青岛游记","date":"2023-08-27T00:00:00.000Z","category":["游记"],"tag":["outing"]},"headers":[{"level":2,"title":"8.23","slug":"_8-23","link":"#_8-23","children":[]},{"level":2,"title":"8.24","slug":"_8-24","link":"#_8-24","children":[]},{"level":2,"title":"8.25","slug":"_8-25","link":"#_8-25","children":[]},{"level":2,"title":"8.26","slug":"_8-26","link":"#_8-26","children":[]},{"level":2,"title":"花费","slug":"花费","link":"#花费","children":[]}],"git":{"createdTime":1693242062000,"updatedTime":1693242368000,"contributors":[{"name":"fenghao","email":"fenghao9523@gmail.com","commits":2}]},"readingTime":{"minutes":6.1,"words":1830},"filePathRelative":"travel/2023.8.27 青岛游记.md","localizedDate":"2023年8月27日","excerpt":"<p>今年的公司outing。入职两年多，这是经历的第三次outing。因为疫情的原因，前年去的千岛湖，去年去的湖州，都乏善可陈。今年outing选项有长沙和青岛，因为之前自己去过了长沙，我是选了青岛，并且幸运的最终结果也是青岛。</p>\\n<h2> 8.23</h2>\\n<p>出发日，下午从公司出发，杭州西-&gt;南京南-&gt;青岛。由于是统一订的行程，没懂为什么从南京南换乘一下。可能是因为杭州直达青岛的车不多，如之前买高铁票经验贴中所说，是在两条线上？<br>\\n由于换乘有一个多小时的间隔，刚好留出了解决晚饭的时间窗口，（并且出门太赶，忘记自己准备晚饭和水）。在南京站里自行解决晚饭。<br>\\n转了一圈，还是KFC比较有性价比，点了个汉堡 + 原味鸡， 36元（如果直接来个四件套，价格就到60了）。随便吃完，再去超市单独买瓶水。<br>\\n这里还发生点小插曲，因为站内有多个KFC，手机点单的时候需要选择具体的店。因为想多看几个店铺，在第一个KFC扫码了但又没点，导致后来在第二个KFC点单时，定位到了第一个KFC，导致要穿过整个高铁站去拿。<br>\\n然后就是南京南-&gt;青岛北，到青岛已经是晚上10点左右。在老板们的带领下，没去酒店，行李都没放，就去台东步行街找了家店吃夜宵（烧烤+啤酒）。不愧是青岛，啤酒的味道和在杭州喝的啤酒大不相同，49一扎，口感非常好，也不胀肚（就是有点后劲）。<br>\\n<br>\\n最后到酒店安顿下来已经2点半，可惜这次住在海边的酒店却不是海景房。</p>"}');export{e as data};
